/******************************************************************************************************************
 * File name: main.c
 * Program Objective: To understand how to utilize the accelerometer and LCD modules in the Educational Boosterpack
 * MKII board.
 * Objectives[1] : 1. The system will consist of the Texas Instruments Tiva C Series TM4C123G LaunchPad and the
 *                 Educational BoosterPack MKII.
                2. A ball (colored in circle  or as close to a circle as you can get) will move around the
                   LCD screen depending on the tilt of the board.
                3. When the system is sitting flat on the table, the ball will be in the center of the screen and
                   will have a diameter of 8 pixels.
                4. When the system is oriented such that the board surface is at a 5 degree angle while one edge is
                   horizontal, the ball will be half way between the edge and the center of the screen and will have
                   a diameter of 4 pixels.
                5. When the system is oriented such that the board surface is at a 10 degree angle while one edge is
                   horizontal for an extended amount of time, the ball will be at the edge of the screen and will
                   have a diameter of 2 pixels.
                6. The ball size and orientation shall work similarly as specified above in the xPosition and yPosition dimension.
                7. The ball size (2, 4 or 8 pixels) shall be set by the location it is on the screen, such that if it
                   is closer to the center it is larger.
                8. The ball size (2, 4 or 8 pixels) shall be set by the location it is on the screen, such that the size
                   changes at about the 1/3 and 2/3 of the distance from the center to the edge of the LCD screen.
                9. The movement of the ball shall be smooth and may not change more than one pixel every 50 milliseconds.
                Note : The ball with pixel size 8, 4 and 2 are too small to see. So for better visibility the ball size has been
                changed to 25, 18 and 9.
 * Description : One Tiva board and the Educational Boosterpack MKII are used for this experiment. The accelerometer in
 * the Boosterpack senses the current acceleration of the board in xPosition and yPosition directions. Using the tilt calculation
 * formula the tilt of the board in xPosition and yPosition direction are measured. The corresponding voltages are converted to digital
 * values using ADC0 and ADC1 modules in the TM4c123GH6PM microcontroller. These values are used to control the position
 * of the ball on the LCD. When the board is flat the ball is at the center of the screen with a diameter of 8 pixels.
 * And when the board is at five degree angle the ball moves to the location between the center and the edge. And when the
 * board is at ten degree angle the ball moves to the edge of the board. The process should be same in all xPosition and yPosition
 * directions.
 * Circuit descriptions and connections[21] : The following connections are made for the program to work properly. R9 and R10 resistors
 * are desoldered from the Tiva board to make use of the port pins PD0, PD1 and PD7.
 * ------------------------------------------------------------
 * Tiva board                           boosterpack MKII board
 * ------------------------------------------------------------
 * PE2(ADC analog input)                Pin 24
 * PE3(ADC analog input)                Pin23
 * PA3(SSI0Fss)                         Pin 13(LCDSPI_CS)
 * PA7(GPIO)                            Pin 17(LCDRST)
 * PA2(SSI0Clk)                         Pin 7(LCDSPI_CLK)
 * PA5(SSI0Tx)                          Pin 15(LCDSPI_MOSI)
 * PA6(GPIO)                            Pin 31(LCD_RS)
 * Vcc                                  Pin 1(Vcc)
 * GND                                  Pin 20(GND)
 * -------------------------------------------------------------
 *
 * External files used[21] : PLL.c, PLL.h, ST7735.h, ST7735.c 
 *References :  [1]Embedded System Design using TM4C LaunchPadTM Development Kit,SSQU015(Canvas file)
 *              [2]Tiva C Series TM4C123G LaunchPad Evaluation Board User's Guide
 *              [3]Tiva TM4C123GH6PM Microcontroller datasheet
 *              [4]TivaWare Peripheral Driver Library User guide
 *              [5]http://processors.wiki.ti.com/index.php/Tiva_TM4C123G_LaunchPad_Blink_the_RGB
 *              [6]Embedded Systems An Introduction using the Renesas RX63N Microcontroller BY JAMES M. CONRAD
 *              [7]CFAF128128B-0145TDatasheetReleaseDate2017-06-28.pdf
 *              [8]ST7735_V2.1_20100505.pdf
 *              [9]CFAF128128B-0145T_Data_Sheet_2014-05-07.pdf
 *              [10]Measuring Tilt with Low-g Accelerometers by: Michelle Clifford and Leticia Gomez
 *              [11]Using an Accelerometer for Inclination Sensing by Christopher J. Fisher
 *              [12]TivaWare Graphics Library User's Guide
 *              [13]Meet the Educational BoosterPack MKII, Part number: BoostXL-EDUMKII
 *              [14]BOOSTXL-EDUMKII Educational BoosterPack™ Plug-in Module Mark II, User's guide
 *              [15]KXTC9-2050 Specifications Rev 2.pdf
 *              [16]http://users.ece.utexas.edu/~valvano/
 *              [17]https://www.youtube.com/watch?v=MWIX7wgS9PM&feature=youtu.be
 *              [18]https://e2e.ti.com/support/microcontrollers/msp430/f/166/t/453698
 *              [19]http://edx-org-utaustinx.s3.amazonaws.com/UT601x/ValvanoWareTM4C123.zip
 *              [20]https://forum.crystalfontz.com/showthread.php/7394-Connecting-the-small-CFAF128128B-0145T-
 *                  TFT-to-an-Arduino-Uno-or-SparkFun-RedBoard
 *              [21]https://dev.ti.com/bpchecker/#/
 *The functions from the ST7735.c and PLL.c are used in the program and wherever they are used citations are given and
 *the copyright of these functions go to: Copyright 2015 by Jonathan W. Valvano, valvano@mail.utexas.edu
 *********************************************************************************************************************/

